function Todo({ todo, toggleStatus, deleteTodo }) {
  return (
    <>
      <tr>
        <th scope="row">1</th>
        <td>Mark</td>
        <td>Otto</td>
        <td>@mdo</td>
      </tr>
      <tr>
        <th scope="row">2</th>
        <td>Jacob</td>
        <td>Thornton</td>
        <td>@fat</td>
      </tr>
      <tr>
        <th scope="row">3</th>
        <td>Larry</td>
        <td>the Bird</td>
        <td>@twitter</td>
      </tr>
      <li
        className="row list-group-item d-flex align-items-center"
        key={todo.id}
      >
        <td
          className="col"
          style={{
            textDecoration: todo.status ? "line-through" : "none",
          }}
        >
          {todo.id}
        </td>
        <td
          className="col"
          style={{
            textDecoration: todo.status ? "line-through" : "none",
          }}
        >
          {todo.title}
        </td>
        <button
          className="col btn btn-outline-primary"
          onClick={() => toggleStatus(todo.id, todo.status)}
        >
          {todo.status ? "Undo" : "Done"}
        </button>
        <button
          className="col btn btn-outline-danger"
          onClick={() => deleteTodo(todo.id)}
        >
          Delete
        </button>
      </li>
    </>
  );
}
export default Todo;
